sys_ux_client_script.script:
/**
  * @param {params} params
  * @param {api} params.api
  * @param {TransformApiHelpers} params.helpers
  */
function evaluateProperty({api, helpers}) {
	if (api.context.props.sysId == "" || api.context.props.sysId == null || api.context.props.sysId === undefined || api.context.props.sysId === '-1')
        return false;
    return true;
}
